import Node from "./ListNode.js"

var n1 = new Node(7)
var n2 = new Node(5)
var temp
var n3 = new Node(0)
n1.appendToTail(1)
n1.appendToTail(6)

n2.appendToTail(9)

while(n1.data != null || n2.data != null){
    temp = n1.data + n2.data
    // if (temp>= 10){
    //     temp = temp%10
    //     n3.data = 1
    // }

    if (n3.node ==null){
        n3.node = temp
    }
    else{
        n3.node += temp
    }
    n3.node = n3.node+temp
    n1 = n1.next
    n2 = n2.next
    n3 = n3.next
}

console.log(n3)
